import React, { useState } from 'react';
import { PdfUpload } from 'react-ipfs-uploader';
import {useForm} from "react-hook-form";



 const Tender=() =>{
  const [pdfUrl, setPdfUrl] = useState('')
  const {handleSubmit}=useForm()


  const onSubmit = (data) => console.log(data);
  return (
    <div className="ui container center">
      <h2> Tender GENERATION</h2>
      <form className="ui form" onSubmit={handleSubmit(onSubmit)}>
        <div className="field">
          <label>Target</label>
          <input type="number" name="Target" placeholder="Target"></input>
        </div>
        <div className="field">
          <label>Minimum Contribution</label>
          <input type="number" name="Minimum Contribution" placeholder="Minimum Contribution"></input>
          <p>Upload protocol for Tender request</p>

          
        </div>
      </form>
      <PdfUpload setUrl={setPdfUrl}>{pdfUrl}</PdfUpload>
      <input type="submit" />
  
    </div>
  );
}
export default Tender
